import React from 'react';
import StyledTopNotch from '../styles/app.tw';

const App = () => {
    return (
        <div class="bg-indigo-900 text-center py-4 lg:px-2">
            <StyledTopNotch>
                <span className="notch_pop">New</span>
                <span className="notch_info">Get the coolest t-shirts from our brand new store</span>
                <svg class="fill-current opacity-75 h-4 w-4" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20"><path d="M12.95 10.707l.707-.707L8 4.343 6.586 5.757 10.828 10l-4.242 4.243L8 15.657l4.95-4.95z"/></svg>
            </StyledTopNotch>
        </div>
    );
}

export default App;
